  false,\n\t\"url\": null,\n\t\"notes\": \"SWFWMD regularly uses digital topographic
  information to support regulatory, land management and acquisition, planning, engineering
  and habitat restoration projects. LiDAR data will support hydrologic modeling activities
  associated with the FederalEmergency Management Agency (FEMA), and in the creation
  of Digital Flood Insurance Rate Maps(DFIRM). The Light Detection and Ranging (LiDAR)
  LAS dataset is a survey of Lake Placid. The Lake Placid LiDAR Survey project area
  consists of approximately 44.8 miles. The LiDAR point cloud was flown at a density
  sufficient to support a maximum final post spacing of 4 feet for unobscured areas.
  3001 Inc. acquired 38 flightlines on March 4, 2007. The data was divided into 5000'
  by 5000' cells that serve as the tiling scheme. The Lake Placid LiDAR Survey was
  collected under the guidance of a Professional Mapper/Surveyor.\",\n\t\"license_title\":
